import { Link as RouterLink, useNavigate } from 'react-router-dom';
import React, { useState } from "react";
import Col from 'react-bootstrap/Col';
import Form from 'react-bootstrap/Form';
import Row from 'react-bootstrap/Row';

const Video = (props) => {
    const [regen, setRegen] = useState('');
    const navigate = useNavigate();
    const handleSubmit = (e) => {
        e.preventDefault();
        console.log(e.target.value);
    }

    let offsetX;
let offsetY;

onDragStart = function(ev) {
  const rect = ev.target.getBoundingClientRect();

  offsetX = ev.clientX - rect.x;
  offsetY = ev.clientY - rect.y;
};

drop_handler = function(ev) {
  ev.preventDefault();

  const left = parseInt(id2.style.left);
  const top = parseInt(id2.style.top);

  id1.style.position = 'absolute';
  id1.style.left = ev.clientX - left - offsetX + 'px';
  id1.style.top = ev.clientY - top - offsetY + 'px';
  id2.appendChild(document.getElementById("id1"));
};

dragover_handler = function(ev) {
  ev.preventDefault();
  ev.dataTransfer.dropEffect = "move";
};

    return (
        <div className='input-container' style={{textAlign:'left'}}>
            <label className='h3-light'>Restore your dream video.</label>


            <button className='button-light' type='submit' onClick={() => navigate("/interpretation")} style={{position: 'relative', left: '70px', top: '120px'}}>Edit</button>
            <button className='button-light' type='submit' style={{position: 'relative', left: '70px', top: '120px', marginLeft:'30px'}}>Save</button>
            <button className='button-light' type='submit' style={{position: 'relative', left: '70px', top: '120px', marginLeft:'30px'}}>Regenerate</button>
            <form className='desc-form' style={{height: '500px'}} onSubmit={handleSubmit}>
            <text className='input-title' style={{textAlign:'center', marginTop:'160px'}}>Generating...</text>
            <text className='input-text' style={{textAlign:'center', marginTop:'30px'}}>This might take minutes, feel free to log out and come back again for your dream video in the dream cloister.</text>
            <div id="id1" draggable="true" ondragstart="onDragStart(event)" style="border:2px solid green; cursor:pointer;width:100px;height:50px;">Dragged Div</div>


            <div id="id2" style="position:absolute;left:200px;top:50px;border:2px solid red; cursor:pointer;width:200px;height:200px;" ondrop="drop_handler(event)" ondragover="dragover_handler(event)">Drop Div
            </div>
            </form>
        </div>
    );
};

export default Video;
